import React from 'react';
import { Link, Route } from 'react-router-dom'
import classes from './Employee.module.css';
let { path, url } = useRouteMatch();
const Employee = (props) => {
 const EmployListProcessed = props.data.map(employee => {
  return (
   <Link to={{ url } + '/employee' + employee.id} key={employee.id}>
    <div className={classes.Employee}>
     <div className={classes.Rounded}>  <img alt="user" src={employee.avatar} /></div>
     <h2> {employee.first_name}  {employee.last_name}</h2>
     <h2>{"B00" + employee.id}</h2>
     <p>Email: {employee.email}</p>
    </div>
   </Link>

  )
 })
 return (
  <>
   <div className={classes.EmployeesWrapper}>
    {EmployListProcessed}
    <Route path={path + "/employee/:id"} render={() => <h2>Employee Info</h2>} />
   </div>
  </>
 )
}

export default Employee;
